#include <iostream>
#include <string>
#include <set>
#include <typeinfo>
using namespace std;
class Solution {
public:
    int findSubstringInWraproundString(string p) {
        int len = p.length();
        if(len == 0)
            return 0;
        set<string> s;
        int a[len][len];
        for(int i=0; i<len; i++){
            for(int j=0; j<len; j++){
                a[i][j] = 0;
            }
            a[i][i] = 1;
            s.insert(p.substr(i,1));
        }

        for(int i=len-2; i>=0; i--){
            for(int j=i+1; j<len; j++){
                if((a[i][j-1]==1) && (p[j]-p[j-1]==1 || p[j]-p[j-1]==-25)){
                    a[i][j] = 1;
                    s.insert(p.substr(i,j-i+1));
                }else{
                    break;
                }
            }
        }
        set<string>::iterator i = s.begin();
        while(i != s.end()){
            cout<<*i<<" ";
            i++;
        }
        return s.size();
    }
};
//int a[9664][9664];
int main(){
    Solution s;
    string b = "";
    int a = s.findSubstringInWraproundString(b);
    cout<<a<<endl;
    return 0;
}
